INSERT INTO `products` (`id`, `title`, `article`, `url`, `primary_image`, `image`, `price`, `sn`, `categorie_id`, `updated_at`, `created_at`, `manufacturer`, `quantity`) VALUES
(41, 'ASUS X99-E LGA 2011-v3 Intel X99 SATA 6Gb/s USB 3.1 USB 3.0 ATX Motherboards - Intel', '<p><b>AWAKEN THE TRUE PERFORMANCE OF X99</b><br>Ready for Intel® Core™ i7 X-Series Processors, X99-E combines renowned 5-Way Optimization 1-click system tuning with onboard USB 3.1 Type C M.2. ASUS Aura RGB lighting syncs onboard LEDs with other Aura-capable components for unprecedented personalization. Lastly, new ASUS SafeSlot keeps your graphics card secure and protected.</p><p><br></p><p><b>AT A GLANCE</b><br></p><ul><li>Next-gen connectivity – Includes extensive upgrades including onboard M.2 slots that tap into 32Gbps of PCIe bandwidth, as well as onboard USB 3.1 Type C</li><li>ASUS Aura – Features controllable RGB onboard lighting and 4-pin strip header that can be synced with an ever-growing portfolio of Aura-capable ASUS hardware</li><li>Patent-pending SafeSlot – Reinvented, strengthened PCIe slot utilizes a new insert-molding process to bind the slot to fortifying metal for superior retention and shearing resistance</li><li>5-Way Optimization: Fan Xpert 4 – Elevates customized cooling to new heights, with the ability to detect PWM/DC fans on all headers, utilize high-amperage fans and control water-cooling pumps in software and UEFI</li><li>Crystal Sound 3 – Gaming-grade audio with unmatched clarity featuring a new power pre-regulator for clean power delivery, which joins ASUS-pioneered noise isolation design and premium audio components</li></ul><p><br></p><p><img style="width: 400px;" src="data:image/jpeg;base64,', 'asusx99elga2011v3intelx99sata6gbsusb31usb30atxmotherboardsintel', '2016.11.13.15.11.14-13-132-835-09.jpg', '2016.11.13.15.11.14-13-132-835-09.jpg,2016.11.13.15.11.14-13-132-835-10.jpg,2016.11.13.15.11.14-13-132-835-11.jpg,2016.11.13.15.11.14-13-132-835-12.jpg,2016.11.13.15.11.14-13-132-835-13.jpg,', '209.00', '9999999', 6, '2016-12-05 14:46:36', '2016-11-13 15:31:14', 0, 7);
INSERT INTO `products` (`id`, `title`, `article`, `url`, `primary_image`, `image`, `price`, `sn`, `categorie_id`, `updated_at`, `created_at`, `manufacturer`, `quantity`) VALUES
(43, 'Crystal Series 460X RGB Compact ATX Mid-Tower Case', '<p><b>Beautifully Tempered</b><br>Beautifully simple and engineered to \r\nperform: the Crystal 460X has two-panel tempered glass, Direct Airflow \r\ncooling technology, is compact, expandable, and with three SP120 RGB \r\nfans, is not afraid of the spotlight.</p><p><br></p><p><b>Three SP120 RGB LED fans</b><br>Light\r\n up your build with brilliant LED effects and draw ample cool air \r\ndirectly to your components without the turbulence that can cause fan \r\nhum.</p><p><br></p><p><b>Room For Activities</b><br>We’ve engineered the\r\n Crystal 460X to pack all the performance and expandability you need \r\ninto a beautifully modern and compact case design. Put your build on \r\ndisplay through beautiful two-panel tempered glass and keep it all \r\nrunning cool and quiet with Direct Airflow technology.</p><p><br></p><p><b>Style Is Everything</b><br>Built\r\n into the chassis are three striking SP120 RGB fans. Make your build \r\nstand out from the crowd by coordinating the custom-molded translucent \r\nblades with your build for a sleek, brilliant look -- all visible \r\nthrough the tempered glass panels.</p><p><br></p><p><b>Clean, modern lines with an all steel exterior</b><br>Get rid of those plastic cases – the 460X has full steel front and top panels for extra durability and gorgeous good looks.</p><p><br></p><p><b>Liquid cooling capable</b><br>With\r\n room for front, top, and rear radiators, you can choose to quiet down \r\nyour GPU and CPU with liquid coolers just about wherever you want to.</p><p><br></p><p><b>Direct Airflow Path</b><br>Drive cages are moved up and out of the path of cool air from the front intake fans and high-temperature components.<br></p><p><br></p>', 'crystalseries460xrgbcompactatxmidtowercase', '2016.11.14.06.11.58-460X_RGB_01.png', '2016.11.14.06.11.58-460X_RGB_01.png,2016.11.14.06.11.58-460X_RGB_02.png,2016.11.14.06.11.58-460X_RGB_03.png,', '139.99', '9999999', 10, '2016-11-23 22:08:57', '2016-11-13 21:05:52', 0, 0),
(44, 'Graphite Series™ 780T Full-Tower PC Case', '<p><b>Premium looks, premium space, premium cooling.</b><br>The stunning Graphite Series 780T Full-Tower PC case can satisfy the most hardcore gamer or overclocker with ample room for nine drives and nearly a dozen large cooling fans. Into water cooling? You’ll appreciate the generous space for dual 360mm radiators. And, you’ll get everything done faster: the 780T offers easy maintenance shortcuts like tool-free removal of side panels, hard drives, and graphics cards. A three-speed fan control button and generous options for peripheral connections make the front-panel a true time saver.<br></p>', 'graphiteseries780tfulltowerpccase', '2016.11.14.06.11.43-780T_Black_001.png', '2016.11.14.06.11.43-780T_Black_001.png,2016.11.14.06.11.43-780T_Black_002.png,2016.11.14.06.11.43-780T_Black_005.png,2016.11.14.06.11.43-780T_Black_007.png,2016.11.14.06.11.43-780T_Black_008.png,', '179.99', '9999999', 10, '2016-12-05 14:46:36', '2016-11-14 06:36:43', 0, 8),
(45, 'Carbide Series® Air 740 High Airflow ATX Cube Case', '<p><b>BIGGER IS BETTER</b><br>CORSAIR Carbide Series PC cases have the high-end features you need, and nothing you don’t. Designed to be the foundation of awesome, yet approachable PCs, they combine the latest case technologies and ergonomic innovations with amazing cooling potential, and plenty of room to build and expand.</p><p><br></p><p><b>Room to Breathe</b><br>The unique design of Carbide Series Air 740 utilizes dual chambers to deliver cooler air to your CPU, graphics cards, motherboard, and memory without your drives or power supply getting in the way.</p><p><br></p><p><br></p>', 'carbideseriesair740highairflowatxcubecase', '2016.11.14.07.11.36-AIR740_01.png', '2016.11.14.07.11.36-AIR740_01.png,2016.11.14.07.11.36-AIR740_02.png,2016.11.14.07.11.36-AIR740_03.png,2016.11.14.07.11.36-AIR740_04.png,2016.11.14.07.11.36-AIR740_05.png,', '149.99', '9999999', 10, '2016-11-23 22:08:41', '2016-11-14 07:25:36', 0, 0),
(46, 'SAMSUNG SSD 850 EVO 500GB 500G SATA III 540MB/S SOLID-STATE HARD DRIVE NEW', '<p><b>Item specifics</b><br>Condition:    <br>New: A brand-new, unused, unopened, undamaged item in its original packaging (where packaging is ... Read more<br>MPN:    <br>Does not apply<br>Storage Capacity:    500 GB    Brand:    <br>Samsung<br>Interface:    SATA III    Form Factor:    2.5"<br>UPC:    <br>Does not apply<br>Model:    <br>850 EVO<br>EAN:    <br>Does not apply<br></p>', 'samsungssd850evo500gb500gsataiii540mbssolidstateharddrivenew', '2016.11.14.07.11.47-s-l1600.jpg', '2016.11.14.07.11.47-s-l1600.jpg,', '181.79', '9999999', 8, '2016-11-23 22:08:35', '2016-11-14 07:35:47', 0, 0),
(47, 'GEFORCE® GTX 1080 30TH ANNIVERSARY', '', 'geforcegtx108030thanniversary', '2016.11.14.09.11.18-product_1_20160913181545_57d7d1d124356.png', '2016.11.14.09.11.18-product_1_20160913181544_57d7d1d0e17a6.png,2016.11.14.09.11.18-product_1_20160913181545_57d7d1d124356.png,2016.11.14.09.11.18-product_2_20160913181545_57d7d1d152d5a.png,2016.11.14.09.11.18-product_2_20160913181545_57d7d1d169e38.png,', '289.99', '9999999', 9, '2016-11-29 22:26:23', '2016-11-14 09:25:18', 0, 3),
(48, 'GEFORCE® GTX 1080 ARMOR 8G OC', '', 'geforcegtx1080armor8goc', '2016.11.14.09.11.11-product_0_20160527170659_57480e333a534.png', '2016.11.14.09.11.11-product_0_20160527170659_57480e333a534.png,2016.11.14.09.11.11-product_1_20160527170658_57480e32e65cb.png,2016.11.14.09.11.11-product_4_20160527170659_57480e3353643.png,2016.11.14.09.11.11-product_4_20160908151251_57d10f7349731.png,', '384.99', '9999999', 9, '2016-11-29 22:23:11', '2016-11-14 09:26:11', 0, 2),
(49, 'GEFORCE® GTX 1080 GAMING X 8G', '', 'geforcegtx1080gamingx8g', '2016.11.14.09.11.00-product_2_20160715161637_57889be5d19b6.png', '2016.11.14.09.11.00-product_2_20160715161637_57889be5d19b6.png,2016.11.14.09.11.00-product_2_20160826095550_57bfa1a628b80.png,2016.11.14.09.11.00-product_4_20160629101245_57732e9d0dfce.png,2016.11.14.09.11.00-product_6_20160629101244_57732e9c5a5b5.png,', '244.99', '9999999', 9, '2016-11-29 20:08:20', '2016-11-14 09:27:00', 0, 4),
(50, 'Hydro Series™ H115i 280mm Extreme Performance Liquid CPU Cooler', '<p><b>A 280mm radiator and dual SP140L PWM fans provide the extreme cooling you need for highly overclocked CPUs</b></p><p>The Hydro Series H115i is an extreme performance, factory sealed, all-in-one liquid CPU cooler for cases with 280mm radiator mounts. The 280mm radiator and dual SP140L PWM fans provide the excellent cooling you need for highly overclocked CPUs. Corsair Link software control is built in, so you can monitor temperatures, adjust cooling performance and customize LED lighting directly from your desktop.</p><p><b><br></b></p><p><b>280mm dual-fan radiator</b></p><p>The key to fast, efficient cooling is maximizing cooling surface area. If your PC case has dual 140mm fan mounts spaced for a 280mm radiator, the H115i lets you take advantage of your case’s full cooling potential.</p><p><b><br></b></p><p><b>Improved coldplate and pump design</b></p><p>Everything’s been tweaked to make the v2 line our best yet. The new design operates more efficiency for both lower temperatures and less noise.</p><p><b><br></b></p><p><b>Dual SP140L PWM fans</b></p><p>The included 140mm fans are custom-designed for high static pressure air delivery with minimum turbulence and noise. They’re PWM controlled, so you can customize the fan speed to find the optimal balance of cooling and noise.<b><br></b><br></p>', 'hydroseriesh115i280mmextremeperformanceliquidcpucooler', '2016.11.14.13.11.31-H115i_02.png', '2016.11.14.13.11.31-H115i_01.png,2016.11.14.13.11.31-H115i_02.png,2016.11.14.13.11.31-H115i_03.png,2016.11.14.13.11.31-H115i_04.png,2016.11.14.13.11.31-H115i_06.png,2016.11.14.13.11.31-H115i_07.png,2016.11.14.13.11.31-H115i_08.png,2016.11.14.13.11.31-H115', '174.99', '9999999', 11, '2016-11-29 22:37:37', '2016-11-14 09:40:42', 0, -2),
(51, 'Air Series AF120 Quiet Edition High Airflow 120mm Fan Twin Pack', '<p><b>High Airflow for Efficient Large-Volume Cooling</b><br>Air Series AF case fans perform best in unrestricted spaces with at least 3 cm (1.2”) of clearance, and they’re ideal for mounting at the rear or top of your PC case as exhaust fans for your PC’s motherboard and CPU, graphics accelerators, and other components that fill the case with heat. They work equally well as unrestricted intake fans for areas like side panels or bottom intakes.<br><br>For high restriction areas like hard drive cages or in other tight spaces where there’s less air volume, check out our Air Series SP models of high static pressure fans.</p><p><br></p><p><b>Performance</b></p><p><b><br></b></p><table class="table table-bordered"><tbody><tr><td><font face="Arial Black"><br></font></td><td align="center"><p><b>AF120 Performance Edition</b><font face="Arial Black"><br></font></p></td><td align="center"><p><b>AF120 Quiet Edition</b><font face="Arial Black"><br></font></p></td></tr><tr><td><p>Size<br></p></td><td align="center"><p>120mm x 25mm<br></p></td><td align="center"><p>120mm x 25mm<br></p></td></tr><tr><td><p>Operating Voltage<br></p></td><td align="center"><p>7V - 12V<br></p></td><td align="center"><p>7V - 12V<br></p></td></tr><tr><td><br></td><td align="center"><p><b>Performance at 12V</b><br></p></td><td><br></td></tr><tr><td><p>Airflow<br></p></td><td align="center"><p>63.47 CFM<br></p></td><td align="center"><p>39.88 CFM<br></p></td></tr><tr><td><p>Static Pressure<br></p></td><td align="center"><p>1.1 mm/H20<br></p></td><td align="center"><p>.5 mm/H20<br></p></td></tr><tr><td><p>Sound Level<br></p></td><td align="center"><p>30 dBA<br></p></td><td align="center"><p>21 dBA<br></p></td></tr><tr><td><p>Speed<br></p></td><td align="center"><p>1650 RPM<br></p></td><td align="center"><p>1100 RPM<br></p></td></tr><tr><td><p>Power Draw<br></p></td><td align="center"><p>0.13 A<br></p></td><td align="center"><p>0.08 A<br></p></td></tr></tbody></table><p><b><br></b><br></p>', 'airseriesaf120quieteditionhighairflow120mmfantwinpack', '2016.11.15.09.11.59-fan_af120_across_r_1_1.png', '2016.11.15.09.11.59-detail_fans_familyshot_b_1_1_1_1_1_1_1.png,2016.11.15.09.11.59-fan_af120_across_r_1_1.png,2016.11.15.09.11.59-fan_af120_back_b_std_1_1.png', '44.99', 'CO-9050002-WW', 11, '2016-11-23 22:07:13', '2016-11-15 09:09:59', 0, 0),
(52, 'Dominator® Platinum Special Edition 32GB (2 x 16GB) DDR4 DRAM 3200MHz C14 Memory Kit — Blackout (CMD32GX4M2C3200C14M)', '<p><br></p><div style="margin: 40px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><h1 style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans", arial, sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px;">DESIGNED FOR THE DISCERNING</h1></div><p><br></p><div style="margin: 15px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">DOMINATOR PLATINUM Special Edition memory is fully compatible with Intel® 100 Series motherboards and is purposefully built with the highest grade sorted ICs, 10-layer PCB for better signaling, patented DHX cooling technology and hand screened by CORSAIR’s memory engineers to ensure maximum overclocking performance and reliability.</p></div><p><br></p><div class="product-detail-titles" style="margin: 0px; padding: 0px; font-size: 22px; line-height: 24px; font-family: "Open Sans", arial, sans-serif; font-weight: normal; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">DOMINATOR HAS AN ALL NEW LOOK</div><p><br></p><div style="margin: 5px 0px 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Available in either chrome or blackout finishes, DOMINATOR PLATINUM Special Edition has been reimagined with a refined, design-forward approach. Premium materials meet meticulous engineering for an unprecedented level of performance and craftsmanship.</p><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;"><br></p></div><p><br class="Apple-interchange-newline"><br></p>', 'dominatorplatinumspecialedition32gb2x16gbddr4dram3200mhzc14memorykitblackoutcmd32gx4m2c3200c14m', '2016.11.24.10.11.26-Dominator_SE_Black_01.png', '2016.11.24.10.11.26-Dominator_SE_Black_01.png,2016.11.24.10.11.26-Dominator_SE_Black_03.png,2016.11.24.10.11.26-Dominator_SE_