(53, 'Vengeance® LPX 8GB (2x4GB) DDR4 DRAM 4333MHz C19 Memory Kit - Red (CMK8GX4M2B4333C19R)', '<p><br></p><h1 style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans", arial, sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Designed for high-performance overclocking on Intel 100 Series motherboards</h1><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">Vengeance LPX memory is designed for high-performance overclocking. The heatspreader is made of pure aluminum for faster heat dissipation, and the eight-layer PCB helps manage heat and provides superior overclocking headroom. Each IC is individually screened for performance potential.</span></p><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;">The DDR4 form factor is optimized for the latest Intel 100 Series motherboards and offers higher frequencies, greater bandwidth, and lower power consumption than DDR3 modules. Vengeance LPX DDR4 modules are compatibility-tested across 100 Series motherboards for reliably fast performance. There’s XMP 2.0 support for trouble-free automatic overclocking. And, they’re available in multiple colors to match your motherboard, your components, or just your style.</span></p><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span></p><div class="product-detail-titles" style="margin: 0px; padding: 0px; font-size: 22px; line-height: 24px; font-family: "Open Sans", arial, sans-serif; font-weight: normal; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);">Features</div><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span></p><div style="margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); height: auto;"><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: left;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Compatibility tested across 100 Series motherboards for reliably fast performance</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Part of our exhaustive testing process includes performance and compatibility testing on most every 100 Series motherboard on the market – and a few that aren’t.</p></div></div><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: right;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Designed for high-performance overclocking</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Each Vengeance LPX module is built from an eight-layer PCB and highly-screened memory ICs. The efficient heat spreader provides effective cooling to improve overclocking potential.</p></div></div></div><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span></p><div style="margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); height: auto;"><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: left;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Pure aluminum heat spreader for faster heat dissipation and cooler operation</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Overclocking overhead is limited by operating temperature. The unique design of the Vengeance LPX heat spreader optimally pulls heat away from the ICs and into your system’s cooling path, so you can push it harder.</p><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">The heat spreader doesn’t just allow Vengeance LPX to run better… the aggressive yet refined form factor looks great in showcase systems.</p></div></div><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: right;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">XMP 2.0 support for trouble-free, automatic overclocking</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Manually pushing your DRAM frequency can be a fun experiment, but sometimes you just want to get maximum performance without the hassle.</p><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Intel 100 Series-based motherboards support the new XMP 2.0 standard, and Vengeance LPX DRAM does, too. Turn it on, and it will automatically adjust to the fastest safe speed for your Vengeance LPX kit. You’ll get amazing, reliable performance without lockups or other strange behavior.</p></div></div></div><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span></p><div style="margin: 0px; padding: 0px; color: rgb(0, 0, 0); font-family: "Gotham SSm A", "Gotham SSm B"; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); height: auto;"><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: left;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Low-profile design fits in smaller spaces</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">When the first Mini-ITX and Micro ATX motherboards for DDR4 are released, Vengeance LPX will be ready. The small form factor makes it ideal for smaller cases or any system where internal space is at a premium.</p></div></div><div style="margin: 0px; padding: 0px; height: auto; width: 380px; float: right;"><div style="margin: 0px; padding: 0px; font-weight: 700;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">Available in multiple colors to match your motherboard or your system</p></div><div style="margin: 15px 0px 0px; padding: 0px;"><p style="margin: 0px 0px 20px; padding: 0px; font-size: 14px; color: rgb(0, 0, 0); line-height: 19px; display: block; -webkit-margin-before: 1em; -webkit-margin-after: 1em; -webkit-margin-start: 0px; -webkit-margin-end: 0px; font-family: "Open Sans", arial, sans-serif;">The best high-performance systems look as good as they run. Vengeance LPX is available in several colors to match your motherboard, your other components, your case… or just your favorite color.</p></div></div></div><p style="margin: 0.67em 0px 10px; padding: 0px; font-size: 28px; font-family: "Open Sans",arial,sans-serif; font-weight: 700; color: rgb(0, 0, 0); line-height: 33px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255);"><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span><span style="color: rgb(0, 0, 0); font-family: "Open Sans", arial, sans-serif; font-size: 14px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); display: inline !important; float: none;"><br></span><br></p><p><br></p>', 'vengeancelpx8gb2x4gbddr4dram4333mhzc19memorykitredcmk8gx4m2b4333c19r', '2016.11.24.14.11.27-VENG_LPX_RED_01.png', '2016.11.24.14.11.27-VENG_LPX_RED_01.png,2016.11.24.14.11.27-VENG_LPX_RED_02.png,2016.11.24.14.11.27-VENG_LPX_RED_03.png,2016.11.24.14.11.27-VENG_LPX_RED_04.png,', '699.99', 'CMK8GX4M2B4333C19R', 7, '2016-11-30 06:00:33', '2016-11-24 14:01:27', 0, 2),
