(64, 'Intel® Core™ i7-6850K Processor  (15M Cache, up to 3.80 GHz)', '<p><br></p><div>\r\n<h2>What is Lorem Ipsum?</h2>\r\n<p><strong>Lorem Ipsum</strong> is simply dummy text of the printing and\r\n typesetting industry. Lorem Ipsum has been the industry\'s standard \r\ndummy text ever since the 1500s, when an unknown printer took a galley \r\nof type and scrambled it to make a type specimen book. It has survived \r\nnot only five centuries, but also the leap into electronic typesetting, \r\nremaining essentially unchanged. It was popularised in the 1960s with \r\nthe release of Letraset sheets containing Lorem Ipsum passages, and more\r\n recently with desktop publishing software like Aldus PageMaker \r\nincluding versions of Lorem Ipsum.</p>\r\n</div><p><br></p><div>\r\n<h2>Why do we use it?</h2>\r\n<p>It is a long established fact that a reader will be distracted by the\r\n readable content of a page when looking at its layout. The point of \r\nusing Lorem Ipsum is that it has a more-or-less normal distribution of \r\nletters, as opposed to using \'Content here, content here\', making it \r\nlook like readable English. Many desktop publishing packages and web \r\npage editors now use Lorem Ipsum as their default model text, and a \r\nsearch for \'lorem ipsum\' will uncover many web sites still in their \r\ninfancy. Various versions have evolved over the years, sometimes by \r\naccident, sometimes on purpose (injected humour and the like).</p>\r\n</div><p><br><br></p><div>\r\n<h2>Where does it come from?</h2>\r\n<p>Contrary to popular belief, Lorem Ipsum is not simply random text. It\r\n has roots in a piece of classical Latin literature from 45 BC, making \r\nit over 2000 years old. Richard McClintock, a Latin professor at \r\nHampden-Sydney College in Virginia, looked up one of the more obscure \r\nLatin words, consectetur, from a Lorem Ipsum passage, and going through \r\nthe cites of the word in classical literature, discovered the \r\nundoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 \r\nof "de Finibus Bonorum et Malorum" (The Extremes of Good and Evil) by \r\nCicero, written in 45 BC. This book is a treatise on the theory of \r\nethics, very popular during the Renaissance. The first line of Lorem \r\nIpsum, "Lorem ipsum dolor sit amet..", comes from a line in section \r\n1.10.32.</p><p>The standard chunk of Lorem Ipsum used since the 1500s is\r\n reproduced below for those interested. Sections 1.10.32 and 1.10.33 \r\nfrom "de Finibus Bonorum et Malorum" by Cicero are also reproduced in \r\ntheir exact original form, accompanied by English versions from the 1914\r\n translation by H. Rackham.</p>\r\n</div><p><br></p>', 'intelcorei76850kprocessor15mcacheupto380ghz', '2016.12.05.15.12.26-b_2.jpg', '2016.12.05.15.12.26-b_2.jpg,', '499.00', '9999999', 5, '2016-12-05 15:20:51', '2016-12-05 15:19:26', 0, 4),
(65, 'ASUS ROG Swift PG279Q Gaming Monitor - 27" 2K WQHD (2560 x 1440) IPS, overclockable 165Hz, G-SYNC™', '<p><b>Display</b></p><p>Flicker freeDisplay Colors : 16.7M (real 8 bit)<br>Response Time : 4ms (Gray to Gray)<br>Viewing Angle (CR≧10) : 178°(H)/178°(V)<br>Contrast Ratio (Max) : 1000:1<br>Brightness(Max) : 350 cd/㎡<br>Pixel Pitch : 0.233mm<br>Display Surface Non-glare<br>True Resolution : 2560x1440    *<br>Panel Backlight / Type : In-Plane Switching<br>Color Saturation : 100%(sRGB) <br>Panel Size: Wide Screen 27.0"(68.6cm) 16:9</p><p><br></p><p><b>Video Feature</b></p><p>GameVisual :6 Modes(Scenery/Racing/Cinema/RTS/RPG/FPS/sRGB Modes)HDCP support : Yes<br>Low Blue Light : Yes<br>GamePlus(modes) : Yes (Crosshair/Timer/FPS Counter)<br>Color Temperature Selection : 4 Modes<br>Trace Free Technology : Yes<br><b><br></b><br><b><br></b><br></p>', 'asusrogswiftpg279qgamingmonitor272kwqhd2560x1440ipsoverclockable165hzgsync', '2016.12.05.15.12.35-b_1.jpg', '2016.12.05.15.12.35-b_1.jpg,2016.12.05.15.12.35-b_2.jpg,2016.12.05.15.12.35-b_3.jpg,2016.12.05.15.12.35-b_4.jpg,2016.12.05.15.12.35-b_5.jpg,2016.12.05.15.12.35-b_6.jpg,', '899.00', '9999999', 48, '2016-12-05 15:30:59', '2016-12-05 15:30:35', 0, 2),
(66, 'Dell S2817Q 28', '<p><b>Incredible screen clarity</b><br><br>Focus on the details.<br><br>• A vision of beauty: Enjoy 28 inches of gorgeous 4K 3840 x 2160 resolution. That’s over 8 million pixels – with four times more detail than Full HD resolution. High pixel density reveals extremely fine details onscreen so you can view and edit higher resolution photos and more. <br><br>• Don’t miss a thing: View content and multitask from two different sources with both Picture-in-Picture and Picture-by-Picture display options.</p><p><br></p><p><b>Entertainment elevated.</b><br><br>Remarkable sound and exceptional visuals provide a feast for the senses.<br>An eye for detail: Ultra HD 4K clarity provides over 8 million pixels of crisp, stunning visuals.<br>Tuned in and turned up: Built-in dual 9W integrated speakers envelope you in clear, rich sound.<br>Packs a visual punch: Smooth, blur-free images and an ultrafast 2ms response time make viewing a pleasure whether you’re watching a game, playing one, or both.</p><p><br></p><p><b>Thoughtfully designed.</b><br><br>Looks good. Performs better.<br>Stay connected: With 2 HDMI ports, 2 USB ports and DP and mini-DP ports, you can play multiple devices at the same time. Switch on your gaming console and media player simultaneously, or try your tablet and streaming device.<br>Designed with style in mind: This sleek monitor provides a deluxe addition to your home with a high-gloss, piano black finish, thin bezels and a matte screen.<br></p>', 'dells2817q28', '2016.12.05.15.12.39-b_1.jpg', '2016.12.05.15.12.39-b_1.jpg,2016.12.05.15.12.39-b_2.jpg,2016.12.05.15.12.39-b_3.jpg,2016.12.05.15.12.39-b_4.jpg,2016.12.05.15.12.39-b_5.jpg,2016.12.05.15.12.39-b_6.jpg,2016.12.05.15.12.39-b_7.jpg,2016.12.05.15.12.39-b_8.jpg,2016.12.05.15.12.39-b_9.jpg,', '459.00', '9999999', 48, '2016-12-05 15:35:05', '2016-12-05 15:34:39', 0, 14),
(67, 'Air Series SP140 LED Green High Static Pressure 140mm Fan', '<p><b>High static pressure cooling with LED illumination.</b><br>Corsair Air Series LED high static pressure PC case fans combine efficient high pressure airflow with striking LED lighting. They’re custom designed to deliver air directly to high-temperature components with less noise and turbulence than ordinary fans. The custom-molded blades are translucent and have a frosted texture, so the light from the four LEDs adds a dramatic effect.</p><p><b>Designed for restricted spaces</b><br>Air Series SP fan models are designed for use in restricted spaces. They’re ideal for radiator and heatsink use, as well as drive bay intakes and other locations where you’re mounting a fan directly adjacent to a heat source. For general purpose case ventilation where you’d like high airflow with minimal excess noise, check out our AF120 and AF140 LED fans.<br></p>', 'airseriessp140ledgreenhighstaticpressure140mmfan', '2016.12.05.16.12.56-fan_SP140_LED_up_G_lit.png', '2016.12.05.16.12.56-fan_SP140_LED_unlit_front_G.png,2016.12.05.16.12.56-fan_SP140_LED_unlit_up_G.png,2016.12.05.16.12.56-fan_SP140_LED_up_G_lit.png,', '24.99', '9999999', 11, '2016-12-05 16:00:56', '2016-12-05 16:00:56', 0, 12),
(68, 'Z170A XPOWER GAMING TITANIUM EDITION', '<p><b>DEDICATED GAMING LAN WITH INTEL®</b><br>Experience a more fluid game with Intel® i219 LAN. Intel® i219 LAN is designed to deliver high performance when gaming, delivering more throughput than other solutions.<br><br>Intel® i219 LAN is optimized for championship level online and LAN eSports by reducing CPU overhead and offering exceptionally high TCP and UDP throughput. This way, your CPU can be used more effectively and you can enjoy more FPS when gaming.</p><p><br></p><p><b>GAMING OPTIMIZED BANDWITH MANAGEMENT</b><br>Dedicated to giving you the best online gaming experience with optimized traffic prioritization and low latency, MSI GAMING LAN Manager automatically classifies and prioritizes the latency-sensitive applications for online games.<br></p>', 'z170axpowergamingtitaniumedition', '2016.12.05.22.12.41-b_1.jpg', '2016.12.05.22.12.41-b_1.jpg,2016.12.05.22.12.41-b_2.jpg,2016.12.05.22.12.41-b_3.jpg,2016.12.05.22.12.41-b_4.jpg,2016.12.05.22.12.41-b_5.jpg,', '349.99', '9999999', 6, '2016-12-05 22:20:49', '2016-12-05 22:20:41', 0, 4),
(69, 'Vengeance® — 64GB Quad Channel DDR3 Memory Kit ', '<p><b>Great Looking, Great Overclocking Memory at a Great Price</b><br>Corsair Vengeance DDR3 memory modules are designed with overclockers in mind. Vengeance DIMMs are built using RAM specially selected for their high-performance potential. Aluminum heat spreaders help dissipate heat, and provide the aggressive look that you want in your gaming rig. As a bonus, the attractive low price of Vengeance memory will also leave lots of room in your system build budget.<br><br><b>Optimized for Compatibility with the Latest CPUs and Motherboards</b><br>Vengeance memory is designed specifically for the latest CPUs. Vengeance modules run at 1.5V for maximum compatibility with all Intel® Core™ i3, i5 and i7 processors, as well as the 2nd generation Intel processor family. Vengeance DDR3 memory is available in single modules, and two or three module kits, making it easy for you to match the DIMM population requirements of your motherboard.<br><br><b>Next-Generation Density for the Ultimate Power User</b><br>Most Vengeance DIMMs are built with two gigabit RAM ICs. These extra-dense memory chips allow you to have 16GB of memory using only two DIMMs, or to populate your triple channel system with up to an insanely large 64GB of system memory for extreme multitasking performance.<br><br><b>Product Description</b><br>High-performance 64GB Vengeance Dual Channel Kit, 1866MHz, 9-10-9-27, 1.5V<br><br><b>Key Features</b><br>Maximize your system memory capacity for ultimate performance<br>Specially selected RAMs for overclocked performance<br>1.5 V VDIMM spec ensures compatibility with 2nd generation (Sandy Bridge) Intel Core processor family<br>Includes XMP performance profile<br>Guaranteed to work on all dual channel Intel platforms<br>Aggressive Look you want<br>Attractively low price<br>World famous Corsair reliability and performance<br>Package Contents<br>Eight 8GB memory modules<br><br><b>System Requirements</b><br>Designed for use with all DDR3 motherboards with four memory channels<br></p>', 'vengeance64gbquadchannelddr3memorykit', '2016.12.05.22.12.44-veng_k_angle_7_1_1.png', '2016.12.05.22.12.44-48-000017_revaa_veng_k_x4_16gb_1_1.png,2016.12.05.22.12.44-veng_k_angle_7_1_1.png,2016.12.05.22.12.44-veng_k_side_7_1.png,', '439.99', '9999999', 7, '2016-12-05 22:29:52', '2016-12-05 22:29:44', 0, 16),
(70, 'Carbide Series® SPEC-01 Red LED Mid-Tower Gaming Case', '<p><b>The essential gaming PC case.</b><br>Carbide Series SPEC-01 is proof that great looks, smart design, and durable construction don’t need to be pricy, and that basic doesn’t need to be boring. You get aggressive styling, a huge side panel window for admiring your components, and an LED-lit front intake fan that draws cool air directly to your graphics cards.<br><br>Inside, there’s room for up to five fans, and the four combination hard drive / SSD trays make storage installation and upgrades quick and easy. Cable routing cutouts help you reduce clutter, and the built-in dust filters help protect your components. Up front, the USB 3.0 connector gets you up to speed with the latest high-performance storage devices.</p><p><br></p><p><b>Huge side panel window</b><br>The aggressive look of the SPEC-01 makes it look great on the outside, but there’s beauty on the inside of a well-built system, too. The large side panel window lets you show it off.</p><p><br></p><p><b>LED front intake fan, with room for more</b><br>The 120mm front intake fan is bathed in soft LED lighting, and it’s oriented to draw cool air directly across your graphics cards. And if you want even more ventilation, you can add a second 120mm fan or even dual 140mm fans.<br></p>', 'carbideseriesspec01redledmidtowergamingcase', '2016.12.05.22.12.52-SPEC01_three_quarter_hero_up.png', '2016.12.05.22.12.52-SPEC01_side_view_opened.png,2016.12.05.22.12.52-SPEC01_three_quarter_hero_back_view.png,2016.12.05.22.12.52-SPEC01_three_quarter_hero_low.png,2016.12.05.22.12.52-SPEC01_three_quarter_hero_up.png,', '74.99', '9999999', 10, '2016-12-05 22:40:58', '2016-12-05 22:33:25', 0, 2),
(71, 'Carbide Series® 330R Titanium Edition Silent Mid-Tower Case', '<p><b>Low noise. High performance.</b><br>The Carbide Series 330R Titanium Edition starts with the award-winning original 330R, and adds a brushed aluminum front panel with a three-speed fan controller.<br><br>It’s designed for systems that will go into media rooms, bedrooms, dorm rooms, or any place where both silence and performance are essential. Sound damped doors and panels and clever intake fan design are combined with generous expansion room and builder-friendly features to allow you to build a silent PC that can pack a lot of power for gaming and high-definition media streaming.</p><p><br></p><p><b>Superior sound absorption</b><br>The top panel, brushed aluminum front panel, and side doors are all lined with noise damping material, and the cleverly designed front intakes help reduce fan noise.</p><p><br></p><p><b>Smart airflow design</b><br>The 330R Titanium Edition incorporates a direct path between the included 140mm fan and your CPU and GPU, providing cold air directly to the hottest components with less restriction and less noise.<br></p>', 'carbideseries330rtitaniumeditionsilentmidtowercase', '2016.12.05.22.12.34-330R_Titanium_01.png', '2016.12.05.22.12.34-330R_Titanium_01.png,2016.12.05.22.12.34-330R_Titanium_02.png,2016.12.05.22.12.34-330R_Titanium_03.png,2016.12.05.22.12.34-330R_Titanium_07.png,2016.12.05.22.12.34-330R_Titanium_10.png,', '99.99', '9999999', 10, '2016-12-05 22:44:41', '2016-12-05 22:44:34', 0, 3),
(72, 'Graphite Series™ 380T Yellow Portable Mini ITX Case', '<p><b>The mobile Mini-ITX case that’s built for speed.</b></p><p>The Graphite Series 380T packs a powerful punch in a portable Mini-ITX PC case. A built-in carrying handle makes transport a breeze. It’s easy to build the road-ready computer of your dreams within a spacious, easy to access interior with room for an extra-long graphics card. You can keep things cool with mounts for up to five fans and a convenient front panel three-speed fan controller.</p><p><b>Built-in carrying handle</b><br>The 380T is made for travel. The handle makes it easy to grab your rig and go, and the handle’s integral design means that it’s there when you need it, and it visually blends into the smooth, molded form when you don’t.</p><p><b>Easy-access transparent side panels</b><br>Both side panels come off easily with the lift of a flush-mount latch – no thumbscrews, no complicated alignment. They combine a metallic hex mesh and dust filter for airflow, and a transparent window to show off your hardware.<br></p>', 'graphiteseries380tyellowportableminiitxcase', '2016.12.05.22.12.47-380T_Yellow_01.png', '2016.12.05.22.12.47-380T_Yellow_01.png,2016.12.05.22.12.47-380T_Yellow_09.png,', '149.99', '9999999', 10, '2016-12-05 23:18:20', '2016-12-05 22:48:36', 0, 3);

